INSERT INTO `categories_url` (`id`, `fathers`, `myAddres`, `type_1`, `descript`, `keys_i`, `name_i`, `img`, `text_main`, `pluses`, `minuses`) VALUES
(1, 0, 'anime', 'direct', 'Аниме обложки вк', 'Ключи аниме', 'Аниме', 'anime-oblojka.png', '<p class=\"p_index container\">В данном разделе собрано более 500 аниме обложек вк. Они представляют собой совершенно разные тайтлы, но главное их объединяет подходящий размер и качество 1920 на 640 пикселей и формат изображения пнг.\n\n<h3 class=\"h3_index container\">Популярные тайтлы</h3>\n<p class=\"p_index container\">Мы стараемся делать фоны по популярным тайтлам. Например Киберпанк бегущий по лезвию, человек бензопила, коносуба и прочие\n<h3 class=\"h3_index container\">Форматы</h3>\n<p class=\"p_index container\">Форматы всех обложек соответствуют требованиям вк  Мы тестируем их на разных сервисах, если же вы хотите увидеть как будет отображаться обложка до загрузки на свою страницу перейдите к изображению и в пк версии просмотрите макап</h3>\n<h3 class=\"h3_index container\">Скачивание обложки</h3>\n<p class=\"p_index container\">Для скачивания обложки в максимальном качестве, необходимо провалиться в саму обложку и нажать на кнопку скачать.</h3> \n<p class=\"p_index container\">Аниме обложки – лучший способ кастомизировать свою страницу в стилистике восточной анимации. Вообще данный тип искусства относится к рисованной и компьютерной графики японских произведений, но за границей Японии принято считать что все творения именно из нее, хотя есть не мало как и западных так и китайский творений. Ниши работы как правило из самый популярных тайтлов но бывают и мало известные. Главным критерием является красота и оригинальность. </p>\n<h3 class=\"h3_index container\">Характеристики</h3>\n<p class=\"p_index container\">Как правило преобладают яркие и строгие цвета, черный, белый, красный. Хотя бывают и романтичные теплые и холодные оттенки, такие  как синий и розовый. Размеры же всех публикаций 1920 на 640 px. Что бы получить нужную обложку после выбора нажмите на кнопку скачать. </p>\n', 0, 0),
(2, 0, 'igry', 'direct', 'game', 'Ключи аниме', 'Игры', 'igri-oblojka.png', '<p  class=\"p_index container\">\nИдеальные игровые обложки, должны полностью отражать дух игры и фокусировать внимание на главных объектах. \nСобственно этим мы  изанимаемся. У нас огромное колличество фонов для вк и каждый день мы дополняем их большим количеством новых работ.\n\nОсновные темы игровых обложек:БДО,Дота 2, Геншин импакт, Лига легенд\nПомимо этого, вы всегда можете попросить нас сделать обложку по интересующей вас теме.</p>', 0, 0),
(3, 0, 'filmy', 'direct', 'Описание Аниме', 'Ключи аниме', 'Фильмы', 'filmi-oblojka.png', '<p class=\"p_index container\">\nМы подготовили обложки для профилей вк, в соответствие с требованиями их публикации. Все самые красивые работы по фильмам которые идеально встанут на вашу стенку находятся в этом отделе. \nНаверное вы сами зачастую увлекались красотой некоторых профилей, с большой вероятностью они взяли фон именно из нашего ресурса.\n\nИ не забывайте - лучшая благодарность для нас, это поделиться в социальных сетях нашим сайтом. Мы работаем для вас.</p>', 0, 0),
(4, 0, 'priroda', 'direct', 'Описание Аниме', 'Ключи аниме', 'Природа', 'priroda.png', '<p  class=\"h3_index container\">\nХочешь разместить классную обложку с природой к себе на сайт? Нравятся реки? Пляжи? озера? Тогда быстрее забирай их к себе! Проходи по нашей галерее и выбирай самые лучшие работу которые подойдут именно тебе! Ведь их можно скачать совершенное бесплатно и разметсить на своем профиле!\nЛучше обложки с природой для профиля у нас на сайте!<p>', 0, 0),
(5, 0, 'zhivotnye', 'direct', 'Описание Аниме', 'Ключи аниме', 'Животные', 'jivotnie.png', '<p  class=\"h3_index container\">\nДанная категория обложек представляет из себя набор стилизованных фотографий городов. Зачастую для выражения своей страницы в вк достаточно подобрать оптимальный город. Ведь видя ее – люди сразу же поймут с одного вы населенного пункта или с разных. Так можно сразу казать таргет общения и интересов. Да и Большинство улиц городов представляют из себя рукописные декорации – лучшие картины. Которые очень привычны нашему городу.\nВсе наши обложки по городам готовятся только из высококлассного материала, особенно часто мы публикуем по таким городам как Москва, Питер и прочие\n</p> <p  class=\"h3_index container\">\nОбложки с животными, это один из самых популярных жанров которые используют пользователи в социальных сетях. Да вы наверное и сами любите котиков и енотиков. А теперь вы можете украсить ими свою страницу.\n</p>\n', 0, 0),
(6, 0, 'goroda', 'direct', 'Описание Аниме', 'Ключи аниме', 'Города', 'goroda.png', '<p  class=\"h3_index container\">\nДанная категория обложек представляет из себя набор стилизованных фотографий городов. Зачастую для выражения своей страницы в вк достаточно подобрать оптимальный город. Ведь видя ее – люди сразу же поймут с одного вы населенного пункта или с разных. Так можно сразу казать таргет общения и интересов. Да и Большинство улиц городов представляют из себя рукописные декорации – лучшие картины. Которые очень привычны нашему городу.\nВсе наши обложки по городам готовятся только из высококлассного материала, особенно часто мы публикуем по таким городам как Москва, Питер и прочие\n</p> \n', 0, 0),
(7, 0, 'geometriya', 'direct', 'Описание Аниме', 'Ключи аниме', 'Геометрия', 'geometriya.png', '<p  class=\"h3_index container\">\nГеометрические обложки для профиля вк можно скачать с нашего сайта, представляют из себя набор различных простых и сложных фигур. Начиная от линии и квадрата, заканчивая сложными фракталами. Ведь все мы знаем, что геометрия как и математика является основоположной наукой, которая определяет, что в природе смотрится хорошо, а что не очень. Скачав наши обложки про геометрию и установив их в свой профиль в вк, вы сразу же обозначите что вы являетесь математическим идеалистом. Простота и красота в 1 флаконе.\n</p>\n', 0, 0),
(8, 0, 'lampy', 'direct', 'Описание Аниме', 'Ключи аниме', 'Лампы', 'lampi.png', '<p  class=\"h3_index container\">\nОбложки с лампами, неоном и просто светяшки для профиля в вк скачать. Мы предоставляем большой набор фонов для социальных сетей, которые являются атрибутами ночного города, неон, лампы и т.д. Эти фоны отлично подчеркнут вашу уникальность и ярко подсветят вашу страницу свои необычным свечением. Ведь яркая страница соц. сетей должна быть у каждого пользователя который является маячком для окружения. Теплый свет неона согреет всех смотрящих на вашу страницу, и очень впечатляющее подчеркнет ее.\n</p>\n', 0, 0),
(9, 0, 'moda', 'direct', 'Описание Аниме', 'Ключи аниме', 'Мода', 'moda.png', '<p  class=\"h3_index container\">\nОбложке с тематикой моды для личных страниц в вк. Скачать фоны по тематики мода, как правило большинство пользователей которые следят за трендами хотят сразу всем и ярко объявить чем они увлекаются. Для таких целей лучшее решения поставить нужную обложку например с одеждой в озаглавите своей страницы. Это не только даст окружающим понять ваши интересы, но отлично будет сочетаться с остальными элементами декора, суммируя и умножая восторг людей от вашего профиля!\n</p>\n', 0, 0),
(10, 0, 'patriotizm', 'direct', 'Описание Аниме', 'Ключи аниме', 'Патриотизм', 'patriotizm.png', '<p  class=\"h3_index container\">\nОбложки для профиля вк с тематикой патриотизм. Скачать флаги РФ, ЛНР, ДНР. А так же символику вооружённых сил рф в формате 1920 на 640 пикселей доступно на нашем сайте. Ведь в такую не легкую минуту для нашей великой страны, очень важно хотя бы изредка показывать, что мать родина очень важна. А поддержка вроде бы совсем простым – символикой ВС РФ является очень полезной. Наверное каждому солдату будет приятно, если его близкие друзья или родственники установят в свой профиль патриотический фон.\n</p>\n', 0, 0),
(11, 0, 'avto-moto', 'direct', 'Описание Аниме', 'Ключи аниме', 'Авто\\мото', 'avto-moto.png', '<p  class=\"h3_index container\">\nОбложки для профиля вк с тематикой Авто и Мото. Фоны для страниц социальных сетей с мотоциклами и автомобилями известных брендов можно скачать тут. В подходящем формате (png). Раздел удобно разбит на подпапки, можно сразу погрузиться в интересующую вас тематику. Для любителей таких брендов как БМВ, Кавасаки и прочих у нас все распложено по полочкам для оптимального пользования и быстрого нахождения нужного материала.\n</p>\n', 0, 0),
(12, 0, 'iskustvo', 'direct', 'Описание Аниме', 'Ключи аниме', 'Искуство', 'iskystvo.png', '<p  class=\"h3_index container\">\nОбложки для профиля вк с тематикой Искусство. Скачать стилизованные обложки из различных творений человечества. Например из популярных картин или фонов сделанных для музыки. Каждый пользователь соц сетей, которые увлекается музыкой или чем-то прекрасным, должен. Нет, просто обязан украсить свою страницу нашими работами. Ведь каждая картина это потенциальная обложка, а каждый фон профиля это потенциальная картина. Укрась свой профиль \n</p>\n', 0, 0),
(13, 0, 'it', 'direct', 'Описание Аниме', 'Ключи аниме', 'ИТ', 'it.png', '<p  class=\"h3_index container\">\nОбложки для профиля вк с тематикой ИТ, Хакеры, Код. Увлекаешься ит? Объяви об этом громко, сделай свою персональную страницу в вк поистине шедевральной. Каждый Итишник, который, хоть чутка владеет кодом, просто обязан показать всем, насколько он выше остальные. Может ты просто увлекаешься хакингом или веб дизайнер или социальный инженер. Все это инструменты современного ит искусства. Ведь код как и инструменты написания его являются истинными математическими иллюстрациями, отражающие всю суть простоты и одновременно сложности таких вещей как радужная таблица. SQL код. \n</p>\n', 0, 0),
(14, 0, 'raznoe', 'direct', 'Описание Аниме', 'Ключи аниме', 'Разное', 'raznoe.png', '<p  class=\"h3_index container\">\nОбложки для профиля вк с тематикой Разное. Скачать в формате пнг и разрешением 1920 на 640 px. В данный раздел попадает все -то. Чему админы ен нашли место.\n</p>\n', 0, 0),
(15, 1, 'tokiyskiy-gul', 'direct', '123', 'Ключи аниме', 'Токийский гуль', 'anime\\tokiyskiy-gul\\tokiyskiy-gul-1.png', 'Формат: PNG.<br>\nРазрешение: 1920 px на 640 px<br>\nКачество скачиваемого изображения: Высокое. <br>\nТип: Обложка (фон) для персональной страницы вк. <br>\nЦветовая схема преимущественно темная. <br>\n<br>\nДля персонализации своей страницы в тематику по аниме токийский гуль. Сделай свою страницу более выразительной установив обложку из популярного тайтала. Ведь настоящий поклонник дед инсайда должен выделять на фоне всех остальных. <br>\n\nО аниме: <br>\nПосле обнаруживания серии преступлений в токио, наш главный гг идет на свидание с милой девушкой и становится гулем. После победы над всеми врагами заводит себе страницы в вк и делает ее достойной настоящего дед инстайда. <br>\n', 0, 0),
(16, 1, 'kiberpank', 'direct', 'Описание Аниме', 'Ключи аниме', 'Киберпанк', 'anime\\kiberpank\\kiberpank-1.png', 'Формат: PNG.<br>\nРазрешение: 1920 px на 640 px<br>\nКачество скачиваемого изображения: Высокое. <br>\nТип: Обложка (фон) для персональной страницы вк. <br>\nЦветовая схема преимущественно неоновая, желтая и немного зеленого с фиолетовым. <br>\n\nИдеальный пак обложек для персонализации своей страницы в социальных сетях. Подходит для любителей хайтек технологий, айтишников и просто фанатов ребекки. Цвета у обложек по большей степени вызывающие и токсичные. Так же присутствуют фоны найт сити. <br>\n\n\nО аниме: <br>\nТы главный герой. У тебя своя шайка киберпсихов и вот ты заходишь в вк. Опять белые и серые фоны? Надоело? Кто вообще из себя этот вк что смеет указывать тебе. Разве правильно заходить серой массой в киберпространство? Нет! <br>\nТолько ты решаешь какая Ребекка будет сегодня украшать твою страницу. Крутой владелец – крутой фон! Тут выживают только сильные и проворные! <br>\n', 0, 0),
(17, 1, 'tsitru', 'direct', 'Описание Аниме', 'Ключи аниме', 'Цитрус', 'anime\\tsitrus\\tsitrus-1.png', 'Формат: PNG.<br>\nРазрешение: 1920 px на 640 px<br>\nКачество скачиваемого изображения: Высокое. <br>\nТип: Обложка (фон) для персональной страницы вк. <br>\nЦветовая схема преимущественно теплые тона. <br>\n\nПак обложек для романтичных людей. Подчеркивает внутреннею красоту и тепло человека. Для фанатов теплых романтичных чувств. Да и в целом для любителей нестандартного аниме цитрус.<br>\n\n\nО аниме: <br>\nТы можешь прекрасно украсить свою страницу. Добавить легкие нотки теплых летних деньков в формате школьной поры. Аниме о девушках, где 2 основные героини это блондинка и брюнетка.\n', 0, 0),
