(48, 1, 'anime-ataka-titanov', 'direct', 'Описание Аниме', 'Ключи аниме', 'Атака титанов', 'anime\\anime-ataka-titanov\\anime-ataka-titanov-1.png', 'Формат: PNG.<br>\nРазрешение: 1920 px на 640 px<br>\nКачество скачиваемого изображения: Высокое. <br>\nТип: Обложка (фон) для персональной страницы вк. <br>\nЦветовая схема преимущественно теплые цвета, черный. <br>\n\nОтличный пак обложек для страниц вк по тайтлу Атака титанов. На взгляд редакции одно из самых популярных аниме. Облагородь свою страницу персонажами или гербом культовой серии. Установив фон из данной категории вы подчеркнете свою любовь к аниме культуре. Каждый кто сталкивался с восточной анимацией знает о этом аниме.<br>\n\n\nО аниме: <br>\nС давних времен человечество ведет войну с огромными существами, которые шныряют везде. Людей спасает только огромная стена состоящая из 3х колец которая и спасает нас всех от вымирания и уничтожения. Но в один день всему этому приходит конец. Стена была разрушена и чудовища уже на подходе.\n', 0, 0),
