(66, 1, 'anime-bezdomniy-bog', 'direct', 'Описание Аниме', 'Ключи аниме', 'Бездомный бог', 'anime\\anime-bezdomniy-bog\\anime-bezdomniy-bog-12.png', 'Аниме обложки для вк по аниме Бездомный бог (Noragami), выполнены со стандартами требований социальной сети. Основной фокус уделяется главному герою и его спутнице. Размещение данных работ у себя в профиле, значительно подчеркнет вашу индивидуальность. Теплые кадры, наполненных любовью это то что надо романтичному профилю. Так же на фон персональной страницы вк можно поставить голубые бездонные глаза. <br>\nО аниме: <br>\nИстории о почти забытом древнем боге, который не имеет храма и вообще почти не популярен. занимается любой работой, хотя раньше был великим воином. Милая девушка пытаясь спасти кота столкнулась с ним. Войны богов и прочее. Все для профиля вк.\n', 0, 0),
