(79, 1, 'anime-blitch', 'direct', 'Описание Аниме', 'Ключи аниме', 'Блич', 'anime\\anime-blitch\\anime-blitch-1.png', 'Аниме обложки вк по аниме Блич (Bleach) подходят для профилей настоящих фанатов данного тайтла. Преимущественно светлые тона, но и много черного. Жёлтые волосы гг отлично сочетаются с монохромными цветами<br>\nО аниме: <br>\nГлавный герой с детсва наблюдал за духами и призраками давно покинувших наш мир людей. Вот ему исполнилось 15 и учится он в старшей школе Японии наших дней. И вот тепреь в неожиданный момент к нему приходит Рукия Кучики. Но она не ожидала что он ее увидит..\n', 0, 0),
