(108, 1, 'anime-elfiyskaya-pesnya', 'direct', 'Описание Аниме', 'Ключи аниме', 'Эльфийская песня', 'anime\\anime-elfiyskaya-pesnya\\anime-elfiyskaya-pesnya-1.png', 'Формат: PNG.<br>\nРазрешение: 1920 px на 640 px<br>\nКачество скачиваемого изображения: Высокое. <br>\nТип: Обложка (фон) для персональной страницы вк. <br>\nЦветовая схема преимущественно темных и багровых тонах. <br>\n\nВк обложки по аниме Эльфийская песня. Соответствуют духу анимации, выполнена в кровавых цветах. Наполненные тьмой одиночеством и болью. Устанавливая их к себе в профиль вы подчеркиваете свою уникальность.\nО аниме: <br>\nПоявилась новая ветвь человечества, которая должна положить конец старым эпохам. Главный герой спасает девушку. И у них зарождается самая искренняя любовь. В аниме много экшен сцен. Правда само оно из начала нулевых, Соответственно и рисовка на любителя.\n', 0, 0),
