(114, 1, 'anime-eta-forforovaya-kukla', 'direct', 'Описание Аниме', 'Ключи аниме', 'Эта форфоровая кукла', 'anime\\anime-eta-forforovaya-kukla\\anime-eta-forforovaya-kukla-1.png', 'Формат: PNG.<br>\nРазрешение: 1920 px на 640 px<br>\nКачество скачиваемого изображения: Высокое. <br>\nТип: Обложка (фон) для персональной страницы вк. <br>\nЦветовая схема преимущественно темных и багровых тонах. <br>\n\nАниме обложка вк по тайтлу эта фарфоровая кукла с очень милой девушкой сделает вашу страницу просто непревзойдённой. А если вы увлекаетесь косплеем, то точно это ваш выбор. Ведь кто может быть милее чем гг? Эта прекрасная косплеерша! Она обязана украсить своим фоном ваш профиль!\nО аниме: <br>\nВакана старшеклассник мечтает стать лучшим мастерам по традиционным японским фарфоровым куклам – он шьет им наряды. Да довольно странное увлечение для парня. И вот он встречает очень миловидную девушку. Она прям как его кукла и он шьет ей наряды \n', 0, 0),
