(127, 1, 'anime-glazki', 'direct', 'Описание Аниме', 'Ключи аниме', 'Глазки', 'anime\\anime-glazki\\anime-glazki-1.png', 'Формат: PNG.<br>\nРазрешение: 1920 px на 640 px<br>\nКачество скачиваемого изображения: Высокое. <br>\nТип: Обложка (фон) для персональной страницы вк. <br>\nЦветовая схема преимущественно светлых тонах<br>\n\nЛюбишь глаза? Да я знаю! Укрась свой профиль в вк этими милыми глазками! Все глаза из аниме в одном месте! Любишь голубые? Зеленые? Да любые, у нас есть глаза для любого фона в вк.\nО аниме: <br>\nЭто не тайтл, а просто набор глаз. Наслаждайтесь!\n', 0, 0),
