(134, 1, 'anime-khanako-kunom', 'direct', 'Описание Аниме', 'Ключи аниме', 'Ханако кун', 'anime\\anime-khanako-kunom\\anime-khanako-kunom-1.png', 'Формат: PNG.<br>\nРазрешение: 1920 px на 640 px<br>\nКачество скачиваемого изображения: Высокое. <br>\nТип: Обложка (фон) для персональной страницы вк. <br>\nЦветовая схема преимущественно разных тонах, красный.<br>\n\nВеликолепные милые аниме обложки по тайтлу Ханако кун Туалетный мальчик. Сделай свою страничку уникальной с фонами для вк в новом стиле, особый шарм аниме подчеркнет твои сильные черты. А профиль твой станет по истине уникальным. <br>\nО аниме: <br>\nВ академии много тайн, если быть точнее то их 8! Седьмая это Ханако, а восьмая это твой профиль? Мы не понимаем, как у тебя может быть настолько крутой профиль в вк. Просто не понимаем! \n', 0, 0),
