(7, 'zhivotnye', 'Обложки для профиля вк с котиками, енотиками и прочими животными', 'Обложки для профиля вк с котиками, енотиками и прочими животными. Ведь животные это лучший способ украсить свою стараницу в социальных сетях', 0),
