(9, 'geometriya', 'Геометрические обложки для профиля вк скачать', 'Геометрические обложки для профиля вк можно скачать с нашего сайта, представляют из себя набор различных простых и сложных фигур. Начиная от линии и квадрата, заканчивая сложными фракталами.', 0),
