INSERT INTO `statii` (`id`, `s_name`, `s_kr_opis`, `s_kr_opis_S`, `s_text`, `s_date`, `s_autor`, `s_show`, `url_s`, `img_s`) VALUES
(1, 'Прикольные аниме обложки', 'Хочешь прикольно украсить свою страницу в вк? Лучший способ этого добиться – добавить обложку. Ведь хорошее оформление привлекает восторженные взгляды людей', 'Хочешь прикольно украсить свою страницу в вк? Лучший способ...', '<p>Хочешь прикольно украсить свою страницу в вк? Лучший способ этого добиться – добавить обложку. Ведь хорошее оформление привлекает восторженные взгляды людей. Это в свою очередь добавляет очки привлекательности в глазах окружения. Какая обложка тебе нужна? Красная с оранжевым и фиолетовым? У нас они есть и абсолютно на любой вкус. </p>\r\n<img src=\"/src/img/statl/prikolnye_anime_oblozhki.png\" alt=\"\">\r\n<p>Как скачать прикольную обложку с нашего сайта? Если ты посмотришь на верх, в шапку сайта то увидишь кнопочку – «галерея обложек». Там выбирай раздел аниме и следом понравившейся тебе тайтл. После выбери максимально подходящую именно тебе, кстати там можно нажимать на стрелочки влево и вправо – листая фоны для вк. А Как понял(-а) что ты влюбился то жми на кнопочку скачать. Да все просто. </p>\r\n<p>А что делать если не нашел подходящий фон для профиля? Переходи в раздел заказать – так же сверху сайта. Пиши свое пожелание, как будет готова твоя уникальная обложка мы тебе ее покажем. Теперь когда у тебя уже скачана любимая обложка, переходи в вк. Там выбираешь свой профиль и жмешь кнопочку «установить обложку» загружай ее. </p>\r\n\r\n<p>Кстати полезно значить значение цветов.\r\nБелый – символ аккуратности.\r\nКрасный – предвестник успеха.\r\nЖелтый – привлекает внимание. </p>\r\n<p>Выбирая цветовую схему обложки вы привязываете соответствующие цвета и эмоции к себе. Ведь каждая страница в конечном итоге ассоциируется с владельцем. Так что для достижения максимального эффекта можно выбирать не только тематику артов но и их цветовой фон. </p>\r\n<p>Так же те кто ищут прикольные аниме обложки, часто обращают внимание на обложки из тайтла <a href=\"/galereya-oblozhek/anime/kiberpank/\">Киберпанк</a>, очень часто им заменяют обложки из раздела «прикольные». Так как у обоих типов очень похожа эмоциональная составляющая. Не хотите аниме обложку? Обратите внимание на раздел «геометрия», а в частности на треугольники. Вы их можете найти перейдя в нужную категорию, выше описанным способом. И не благодарите нас. </p>\r\n<p>При установке надо сфокусироваться на одной проблеме. Необходимо устанавливать обложку именно с пк. Либо перейти в браузер на телефоне и активировать режим «полная версия». В противном случае высок шанс, что в мобильной версии вам все понравится, а на пк будет просто порезанный кусок. После установки проверьте обе версии. </p>\r\n', '09.12.22', 'main', '1', 'prikolnye_anime_oblozhki', 'prikolnye_anime_oblozhki.png'),
(25, '1590х530 обложка вк аниме ', 'Ранее в вк для обложек использовался формат 1590 на 530 пикселей. Сейчас же этот формат считается устаревшим. Так как в сентябре вышло обновление добавившее обложки на личные страницы.', 'Ранее в вк для обложек использовался формат 1590 на 530 пикселей. Сейчас же этот формат считается устаревшим.', '<p>Ранее в вк для обложек использовался формат 1590 на 530 пикселей. Сейчас же этот формат считается устаревшим. Так как в сентябре вышло обновление добавившее обложки на личные страницы. А в ноябре вышли обновления для обложек групп. Пустив все старые форматы под откос. </p>\r\n<p>У нас в паблике большое количество обложек формата 1920 на 640 пикселей, они оптимально подходят для персональных страниц. Но если же вам нужна именно 1590 обложка, то в данной статье я расскажу как ее сделать в пару кликов. </p>\r\n<p>Шаг 1 скачиваем понравившуюся обложку, их можно найти в разделе <a href=\"/galereya-oblozhek/\">«галерея обложек»</a> сверху в меню, дале переходим по группам и темам и выбираем понравившуюся. </p>\r\n<p>Шаг 2 Запускам Фотошоп, жмем создать новый документ (сочетание клавиш cnrl+n) после выбираем нужный формат. Указываем ширину в 1590 px и высоту в 530px. </p>\r\n<img src=\"/src/img/stat/1590kh530-oblozhka-vk-anime-primer.png\" />\r\n<p>Шаг 3 Перетаскиваем ранее сохраненное изображение в зону редактирования. Далее растягиваем на всю область. Если не растягивается жмем ctrl+t. Все теперь экспортируем в нужном формету. </p>\r\n\r\n<p>Сложностей при изменение формата не возникнет, так как у обоих форматов одинаковое соотношение сторон 1 к 3. </p>\r\n', '09.12.22', 'main', '1', '1590kh530-oblozhka-vk-anime', '1590kh530-oblozhka-vk-anime.png'),
(26, 'Обложка для вк аниме джо джо', 'Тебе хочется сделать свою страничку вк более индивидуальной? Есть решение – установи уникальную обложку.', 'Тебе хочется сделать свою страничку вк более индивидуальной? ', '<p>\nТебе хочется сделать свою страничку вк более индивидуальной? Есть решение – установи уникальную обложку. Тогда и люди будут видеть твою оригинальность. И это создаст интерес со стороны друзей. Что бы ты хотел видеть на своей станице? Неоновый розовы с голубым? Тут ты найдешь именно то, что понравится именно тебе.\nКаким образом установить обложку аниме с нашего сайта?\nПросто нужно выбрать пункт «галерея обложек», который находится в верхней части сайта.\nЗатем просто нажми раздел «Аниме»\nКлацни на желаемое Аниме, допустим «Джо Джо» \nИ теперь ты можешь найти именно ту обложку, которая понравится больше всего.\nМожешь заметить кнопки по левую и правую стороны обложки, если нажать на них, картинки будут перелистываться. Как только твой выбор остановился на одной из представленных обложек. Просто жми на кнопку «Скачать».\n</p>\n<img src=\"\\src\\img\\prew\\anime\\anime-jojo\\anime-jojo-1.png\">\n<a href=\"/galereya-oblozhek/anime/anime-jojo/anime-jojo-1/\">Открыть</a><br><br>\n<img src=\"\\src\\img\\prew\\anime\\anime-jojo\\anime-jojo-2.png\">\n<a href=\"/galereya-oblozhek/anime/anime-jojo/anime-jojo-2/\">Открыть</a><br><br>\n<img src=\"\\src\\img\\prew\\anime\\anime-jojo\\anime-jojo-3.png\">\n<a href=\"/galereya-oblozhek/anime/anime-jojo/anime-jojo-3/\">Открыть</a><br><br>\n<p>\nТак и не нашлась та самая? Нажми на кнопку «заказать» Заполни не сложную форму, в которой подробно расписано, какие действия нужно предпринять, для желаемого результата. В ближайшее время тебе напишет наш администратор и лично вручит желаемую обложку.\n\nСкачал, а вот как установить не знаешь?\nЗайди на свою страничку, жми «установить обложку»\nИ вау! Страница теперь не такая скучная!\n\nНа заметку: что означают цвета\nФиолетовый цвет – Магия,  Волшебство\nЖелтый цвет – Радость и Счастье\nЗеленый цвет – Упорство и сила.	\n\nПодбирая цвета в вашей обложи, вы показывает окружающим свое настроение. От этого и люди будут понимать, какой вы сегодня, грустны, романтичный или весёлый. По этому внимательно смотрите не только на тему, но и на цвета, которые есть в вашей будущей обложки. \n</p>\n<p>\nТакже вас может заинтересовать Фон по аниме <a href=\"/galereya-oblozhek/anime/anime-berserk/\">Берсерк</a>, Отлично вписываются обложки по теме «геометрия» , так как они очень похожи по цветовой гамме.\n\nМы предлагаем только качественные обложки, которые не просто обрезка фотографии или какой ни будь картинки. Наши ретушеры тратят свои силы для создания полноценных обложек.\n\nНемного рекомендаций по установке вашей новой обложки, эффективней всего будет установить её через компьютер или ПК версию Вконтакте, это связано с тем, что при установке с мобильного приложения, картинка очень сильно обрезается, и часть обложки просто не помещается. И те, кто общается с вами с компьютера тоже будут видеть ваш фон обрезанным, что в следствии будет создавать неприятные эмоции.\n</p>\n', '10.12.22', 'main', '1', 'oblozhka-dlya-vk-anime-dzho-dzho', 'oblozhka-dlya-vk-anime-dzho-dzho.png'),
(32, 'обложка для вк аниме магическая битва', 'обложка для вк аниме магическая битва', 'Если вы настоящий ценитель восточной анимации, то ваш очевидный выбор это фоны по тайтлу магическая битва.', '<p>Хотите украсить свой профиль в вк крутой и классной обложкой? Зачастую для этого хорошо подходят карды аниме. Если вы настоящий ценитель восточной анимации, то ваш очевидный выбор это фоны по тайтлу магическая битва. В произведение поистине уникальный главный герой, обладающий не малыми способностями благодаря пальцам мертвеца. Оно само по себе наполненное экшен сценами, красочными персонажами.\r\nЧасто для улучшения восприятия вашего профиля, берут ярких персонажей. В данной подборочке их довольно много. Можно сказать все сцены были созданы специально что бы украсить ваше профиль. Все работы выполнены в разрешение 1920 на 640 пикселей, как того и требует социальная сеть.</p>\r\nВот ряд работа:\r\n<img src=\"/src/img/lower/anime/anime-magicheskaya-bitva/anime-magicheskaya-bitva-1.png\">\r\n<img src=\"/src/img/lower/anime/anime-magicheskaya-bitva/anime-magicheskaya-bitva-2.png\">\r\n<img src=\"/src/img/lower/anime/anime-magicheskaya-bitva/anime-magicheskaya-bitva-3.png\">\r\n<p>\r\nЕсли вам нужны другие обложки с данного аниме, то перейдите в раздел и кликами вправо-влево выберете самую нужную для вас. А если вы пожелаете взять за основу другой тайтл то перейдите в категорию <a href=\"\">аниме</a>, которая находится в галерее обложек, и скачайте нужный вам файл.\r\nХочу обратить ваше внимание, на важность использования психопортерета цветы.\r\nНапример красный с черным символ власти, А голубой – спокойствия.\r\nПосле загрузки файла к себе на устройство, просто перейдите в свой профиль, нажмите на установить обложку и выберете скачанный файл. Часто при загрузки с мобильного телефона, возникает неправильное выделение области видимости, поэтому советуем устанавливать обложку с пк.</p>\r\n', '12.12.22', 'main', '1', 'oblozhka-dlya-vk-anime-magicheskaya-bitva', 'oblozhka-dlya-vk-anime-magicheskaya-bitva.png'),
(33, 'Размер фотографии для обложки вк', 'Размер фотографии для обложки вк', 'Какие требования требования у вк к обложкам персональных страниц. Размер фотографии для обложки вк', '<p>\r\nКакие требования требования у вк к обложкам персональных страниц?</p>\r\n<p>Формат: JPG, JEPG WEBP и PNG\r\nМы считаем, что лучше всего загружать именно в пнг формате, так как в таком случае, качество изображения максимальное, все таки это довольно свежий формат.</p>\r\n<p>Разрешение: 1 к 3 , 1 к 2. Рекомендуемое разрешение 1920 на 640 px\r\nТут главная проблема. Если мы загрузим с пк обложку 1 к 3, то пк версия отобразиться нормально, а телефонная версия обрежется до 1 к 2. Но если мы загружаем с телефона обложку 1 к 3, то на телефон она обрезается до 1 к 2, откидывая боковые стороны. А при просмотре с пк, она режется еще сильнее делая из формата 1 к 2 -> 1 к 3. Обрезая верх и низ.</p><p>\r\nПоэтому мы настоятельно рекомендуем загружать фоны именно с пк, если такового нет, то авторизовывайтесь в браузере на телефоне, далее включаете режим отображения десктопной версии и уже тогда загружаете в вк.</p>\r\n', '12.12.22', 'main', '1', 'razmer-fotografii-dlya-oblozhki-vk', 'razmer-fotografii-dlya-oblozhki-vk.png'),
(34, 'Обложка вк аниме гуль', 'Обложка вк аниме гуль', 'Украшая свою страницу в вк, нашим фоном по данной анимации, мы хотим что бы ваш профиль источал все те же самые ноты.', '<p>Аниме токийский гуль, стал в культовым произведением искусства. Своим мрачным духом, наполненным безысходностью, которая сочиться из каждого уголка экрана обезоруживает. Обложки по гулю в первую очередь символизируют дух лучика надежды в полнейшем мраке. Почти всегда они выполнены в темных тонах, напоминающие закоулки бедных районов Токио, где гули вели охоту на людей.  \r\n</p><p>Украшая свою страницу в вк, нашим фоном по данной анимации, мы хотим что бы ваш профиль источал все те же самые ноты. Запах отречённости, пустоты и боли. Каждый кто смотрит на ваш профиль должен понимать что это настоящий дед инсайд.\r\n</p><p>Фокус обложек как правило обращен на главного героя. Вот ряд примеров.</p>\r\n<h3>Примеры</h3>\r\n<img src=\"\\src\\img\\prew\\anime\\tokiyskiy-gul\\tokiyskiy-gul-1.png\">\r\n<img src=\"\\src\\img\\prew\\anime\\tokiyskiy-gul\\tokiyskiy-gul-3.png\">\r\n<img src=\"\\src\\img\\prew\\anime\\tokiyskiy-gul\\tokiyskiy-gul-5.png\">\r\n<br><br>\r\n<p><a href=\"/galereya-oblozhek/anime/tokiyskiy-gul/\">Открыть все обложки по токийскому гулю.</a></p>\r\n', '13.12.22', 'main', '1', 'oblozhka-vk-anime-gul', 'oblozhka-vk-anime-gul.png'),
(35, 'Обложка для вк неон', 'Обложка для вк неон', 'Разве что-то может быть лучше холодного света неона? ', '<p>Не так давно вк добавил новую фичу, обложки для личных страниц. И вот люди хлынули за поиском качественных готовых работ. \r\nЕсли вы тут, то вы нашли что искали. Разве что-то может быть лучше холодного света неона? \r\nНиже приведенные работы (в низком качестве) и ссылка на скачивание в высоком качестве.</p>\r\n<p><a href=\"/galereya-oblozhek/lampy/lampy-neon/\">Жми сюда что бы скачать</a></p>\r\n<br>\r\n<img src=\"\\src\\img\\prew\\lampy\\lampy-neon\\lampy-neon-1.png\">\r\n<img src=\"\\src\\img\\prew\\lampy\\lampy-neon\\lampy-neon-2.png\">\r\n<img src=\"\\src\\img\\prew\\lampy\\lampy-neon\\lampy-neon-3.png\">\r\n<img src=\"\\src\\img\\prew\\lampy\\lampy-neon\\lampy-neon-4.png\">\r\n<img src=\"\\src\\img\\prew\\lampy\\lampy-neon\\lampy-neon-5.png\">\r\n<br><br>\r\n<p><a href=\"/galereya-oblozhek/lampy/lampy-neon/\">Жми сюда что бы скачать</a></p>', '13.12.22', 'main', '1', 'oblozhka-dlya-vk-neon', 'oblozhka-dlya-vk-neon.png'),
(36, ' Обложки для вк аниме 1920x640', ' Обложки для вк аниме 1920x640', 'Неожиданное обновление вк, добавило обложки для личных профилей', '<p>Неожиданное обновление вк, добавило обложки для личных профилей, как раньше были у групп.\nНовые элемент декора является картинкой, предпочтительно пнг формата и соотношением сторон 1920x640 пикселей \n(соотношение длины к ширине 3 к 1) Наш ресурс уже подготовил более 3000 обложек, но пока опубликовал только 1000.\n Вы можете их скачать перейдя в раздел <a href=\"/galereya-oblozhek/\">галерея</a> обложек и выбрать нужную тематику.\n</p><p>Вот ряд примеров.</p><br><br>\n\n\n<img src=\"\\src\\img\\prew\\lampy\\lampy-vyveski\\lampy-vyveski-3.png\">\n<img src=\"\\src\\img\\prew\\patriotizm\\patriotizm-vooruzhennye-sily\\patriotizm-vooruzhennye-sily-4.png\">\n<img src=\"\\src\\img\\prew\\it\\it-kod\\it-kod-2.png\">\n<img src=\"\\src\\img\\prew\\igry\\igry-kiberpank\\igry-kiberpank-7.png\">\n<img src=\"\\src\\img\\prew\\anime\\anime-chelovek-benzopila\\anime-chelovek-benzopila-1.png\">', '13.12.22', 'main', '1', 'oblozhki-dlya-vk-anime-1920x640', 'oblozhki-dlya-vk-anime-1920x640.png'),
(37, 'обложка для вк человек бензопила', 'обложка для вк человек бензопила', 'А что делает настоящий фанат аниме человек бензопила? Правильно, устанавливает Пауэр или Макиму на фон своей страницы.', '<p>\r\nС самым свежим обновлением для вк добавили такие долгожданные обложки. Теперь можно устанавливать фоны на персональные страницы. А что делает настоящий фанат аниме человек бензопила? Правильно, устанавливает Пауэр или Макиму на фон своей страницы. Хотя можно и остальных персонажей этого замечательного тайтла вклеить к себе на декор.\r\n</p><p>Мы подготовили более 50 обложек для вк человек бензопила, вот часть из них. (они тут в низком качестве, что бы ваш трафик пока вы читаете статью не ел). А скачать это обложки как и остальные в высоком качестве можно тут «аниме обложки человек бензопила»\r\n</p><br>\r\n<img src=\"\\src\\img\\prew\\anime\\anime-chelovek-benzopila\\anime-chelovek-benzopila-1.png\" />\r\n<a href=\"/galereya-oblozhek/anime/anime-chelovek-benzopila/anime-chelovek-benzopila-1/\">скачать №1</a>\r\n\r\n<img src=\"\\src\\img\\prew\\anime\\anime-chelovek-benzopila\\anime-chelovek-benzopila-18.png\" />\r\n<a href=\"/galereya-oblozhek/anime/anime-chelovek-benzopila/anime-chelovek-benzopila-18/\">скачать №18</a>\r\n\r\n<img src=\"\\src\\img\\prew\\anime\\anime-chelovek-benzopila\\anime-chelovek-benzopila-19.png\" />\r\n<a href=\"/galereya-oblozhek/anime/anime-chelovek-benzopila/anime-chelovek-benzopila-19/\">скачать №19</a>\r\n\r\n<img src=\"\\src\\img\\prew\\anime\\anime-chelovek-benzopila\\anime-chelovek-benzopila-21.png\" />\r\n<a href=\"/galereya-oblozhek/anime/anime-chelovek-benzopila/anime-chelovek-benzopila-21/\">скачать №21</a>\r\n\r\n<img src=\"\\src\\img\\prew\\anime\\anime-chelovek-benzopila\\anime-chelovek-benzopila-29.png\" />\r\n<a href=\"/galereya-oblozhek/anime/anime-chelovek-benzopila/anime-chelovek-benzopila-29/\">скачать №29</a>\r\n\r\n<img src=\"\\src\\img\\prew\\anime\\anime-chelovek-benzopila\\anime-chelovek-benzopila-53.png\" />\r\n<a href=\"/galereya-oblozhek/anime/anime-chelovek-benzopila/anime-chelovek-benzopila-53/\">скачать №53</a><br><br>\r\n\r\n\r\n<a href=\"/galereya-oblozhek/anime/anime-chelovek-benzopila/\">Все обложки по человеку бензопила</a>\r\n', '13.12.22', 'main', '1', 'oblozhka-dlya-vk-chelovek-benzopila', 'oblozhka-dlya-vk-chelovek-benzopila.png');
